import React from 'react'

function Gallery() {

    const currentCatagory = {
        name: "commercial",
        description:
        "Photos of grocery stores, food trucks, and other commercial projects"
    }

    return(
        <section>
            <h1>{currentCatagory.name}</h1>
            <p>{currentCatagory.description}</p>
        </section>
    )
}

export default Gallery;
